	(7,1,3,'new-post','Увидеть Париж и… влюбиться в его цветы!','Заметки флориста-путешественника, Париж','','','<p>Париж&hellip; У парижан цветочные лавочки буквально на каждом шагу. Большие, с витринами в полквартала, и совсем крошечные, в одно окошко. Они создают даже в самых невзрачных улочках атмосферу праздника и лета. Хотя, что это я говорю. Невзрачных улиц в Париже я не увидела :-) Зато видела в самом центре города большой цветочный рынок.</p>\r\n<p><img class=\"align-left\" src=\"/modules/amazzingblog/views/img/uploads/posts/7/l/11-5c09411dbde33.jpg\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><img class=\"align-left\" src=\"/modules/amazzingblog/views/img/uploads/posts/7/m/5-5c093864dc957.jpg\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Чаще всего посетители этих магазинов выбирают цветы и букеты не в подарок, как принято у нас, а для себя. Стоя у витринных ваз, они подбирают цветы, пробуют сочетание оттенков и самостоятельно собирают букеты. Потом заворачивают свое творение в простую белую бумагу и уносят домой.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Вообще цветы тут можно встретить практически везде, будь то витрина обувного магазина, фойе отеля или уютный зал кондитерской. Цветочные композиции подчеркивают достоинства интерьера, добавляя ему красок. Например, строгие каллы продолжают линии интерьера классического отеля, а романтичные ранункулюсы навевают зефирное настроение в кондитерской.</p>\r\n<p><img class=\"align-left\" src=\"/modules/amazzingblog/views/img/uploads/posts/7/m/7-5c09387fe369a.jpg\" /><img class=\"align-left\" src=\"/modules/amazzingblog/views/img/uploads/posts/7/m/6-5c09387cd8027.jpg\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><img class=\"align-left\" src=\"/modules/amazzingblog/views/img/uploads/posts/7/m/8-5c09389343a7f.jpg\" /><img class=\"align-left\" src=\"/modules/amazzingblog/views/img/uploads/posts/7/m/9-5c0938ad81903.jpg\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','2018-12-06 17:40:53');
