VALUES
	(1,1,0,'Прошу набрать, чтобы уточнить детали времени доставки','','','','2018-08-27 19:49:58','2018-08-27 19:49:58',1,0),
	(2,2,0,'Hi!\r\n\r\nNice flower content you have on your site. You know, MOST customers look at your review pages before visiting and ordering at your business. \r\nOver 63% of them check Google first!  We feel that you could use a little help at Google and Zomato.\r\n\r\nMost customers avoid leaving reviews unless they have a BAD experience to share! \r\nWe have just the team  to come up with great reviews you are looking for. \r\nOur services help keep at least a 4 star rating in order to avoid losing business to competitors! \r\n\r\nWe provide reliable Google, SiteJabber, TrustPilot, TripAdvisor, Facebook, Zomato, YellowPages reviews in bulk, starting at $20 in as little as 5 business days!\r\n\r\nCheck out our work and happy clients here: \r\nhttp://bit.ly/ormworks\r\n\r\nThanks for your time,\r\n\r\nHave a great day.\r\nTawanna','','3106827928','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/69.0.3497.100 Safari/537.36','2018-11-13 22:54:24','2018-11-13 22:54:24',0,0);
